import React from "react";
import { JobType } from "../redux/jobSlice";
import styles from "./Job.module.css";

const Job: React.FC<JobType> = (props: JobType) => {
  return (
    <div className="styles.container">
      <div className="main">
        <p>Sub info</p>
        <p>Location</p>
      </div>
    </div>
  );
};

export default Job;
